import React from 'react';

import './Tab.css'

import {VscListFlat} from "react-icons/vsc";

function Tab({tab, active, onClick, onClose}) {
    return (
        <div className={`tab ${active ? 'active' : ''}`} onClick={() => onClick(tab)}>
            <VscListFlat className="tab-icon"/>
            <span>{tab.title}</span>
        </div>
    );
}

export default Tab;
